import React from "react";
import { BrowserRouter, Route } from "react-router-dom";

const App = () => {
  return (
    <div>
      <h1>Register</h1>
      <form>
        <input type="text" placeholder="Name" />
        <input type="email" placeholder="Email" />
        <input type="password" placeholder="Password" />
      </form>
    </div>
  );
};

export default App;
